@SCCP19I0 @sxavierfilho Era um grande time naquilo que se propunha a fazer, mas não entregava metade do que o Flamengo está fazendo.

Esse Corinthians aí representa o resultadismo que matou o prazer de se assistir o futebol brasileiro - e se tornou regra.
Esse Flamengo é a luz no fim do túnel.
